import React, {Component} from 'react';


class login extends Component {



render(){  return (
  <h1> Taken </h1>,

  this.props.todos.map((todo) =>(
    <ToDoItem todo = {todo} markComplete = {this.props.markComplete}/>
  ))

  );
}
}
export default login;
